<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>Birthday Countdown</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      text-align: center;
      padding: 50px;
      background-color: #f0f8ff;
    }
    .countdown {
      font-size: 50px;
      color: #ff6347;
    }
    .message {
      font-size: 30px;
      color: #2e8b57;
    }
  </style>
</head>
<body>

  <h1>Countdown to My Birthday!</h1>
  <div class="countdown" id="countdown"></div>
  <div class="message" id="message"></div>

  <script>
    // Use format: new Date(year, monthIndex, day, hour, minute, second)
    // Month is 0-indexed: 4 = May
    const birthday = new Date(2025, 4, 18, 12, 45, 0).getTime();

    const interval = setInterval(function() {
      const now = new Date().getTime();
      const distance = birthday - now;

      if (distance <= 0) {
        clearInterval(interval);
        document.getElementById("countdown").innerHTML = "Happy Birthday!";
        document.getElementById("message").innerHTML = "It's time to celebrate!";
        return;
      }

      const days = Math.floor(distance / (1000 * 60 * 60 * 24));
      const hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
      const minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
      const seconds = Math.floor((distance % (1000 * 60)) / 1000);

      document.getElementById("countdown").innerHTML =
        days + "d " + hours + "h " + minutes + "m " + seconds + "s ";
    }, 1000);
  </script>
